import React from "react";

const SocialLinks = (props) => {
  const SocialMedia = props.socialMedia.map((social) => (
    <li>
      <a href={social.link}>{social.mediaName}</a>
    </li>
  ));
  return (
    <div>
      <h3>Contact With Me</h3>
      <ul>{SocialMedia}</ul>
    </div>
  );
};

export default SocialLinks;
